	option.WithApiKey(
		"<YOUR_AUTH_TOKEN>",
	),
)
response, err := client.Service.GetWithBearerToken(
	ctx,
	option.WithHTTPClient(
		&http.Client{
			Timeout: 5 * time.Second,
		},
	),
)

